import '../src/App.css';
import Chat from './Chat';
import Sidebar from './Sidebar';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function App() {
  return (
    //BEM naming covention

    <div className="app">

      <div className="app_body" >

      <Router>
              <Sidebar/>
              <Switch>
                <Route path="/rooms/:roomId">
                  <Chat/>
                </Route>
                <Route path="/">
                  {/* <Chat/> */}
                </Route>              
              </Switch>            
            </Router>
      </div>
    </div>
  );
}

export default App;
